import React from 'react'
import background1 from '../background1.svg'
import background2 from '../background2.svg'
import background3 from '../background3.svg'
const SignIn = () => {
  const margin = {
    marginRight: '-22px',
    marginBottom: '-107px',
  };
  return (
    <div>
      <img src={background1} width="828" height="443" viewBox="0 0 828 443" fill="none"/>
      <img
      src={background2}
      width="454.085"
      height="982"
      viewBox="0 0 828 443"
      fill="none"
      style={{ ...margin }}
      alt="Background Image"
    />
      <img src={background3} width="948" height="548" viewBox="0 0 828 443" fill="none"/>
    </div>
  )
}

export default SignIn
